import React, {useState} from 'react';
import SocialIcons from './SocialIcons'
import joe from './image.jpg'
import axios from 'axios';




function shuffleClicked() {
  axios.get("/api/gettpodcast")
  .then(response => console.log(response))
}
function App() {
  const [podcastDetail, setPodcastDetail] = useState(null);
  return (
    <div className="App">
      <header><h1>Podcast Ideas</h1></header>
      <div className="container">
        <div className="content">
        <div className="square">
          <h1 style={{
            textAlign:"center",
            fontFamily: 'PT Serif, serif'
          }}>The Joe Rogan Experience</h1>
          <img src={joe}></img>
          <div className="social-icons">
            <SocialIcons></SocialIcons>
          </div>

        </div>
       </div>
       <div className="button-container">
        <button className="shuffle-button" onClick={shuffleClicked}>Shuffle</button>
        </div>
      </div>



    </div>
  );
}

export default App;
